import React from 'react'
import {useSelector} from 'react-redux';
import {selectTransactions} from '../../redux/transaction/transaction.selectors';

import {
	TransactionContainer,
	HeaderContainer,
	TypeContainer,
	DateContainer,
	TableContainer,
	AmountContainer,
	TransferContainer,
	MoneyContainer
} from './transaction.styles';

const Transaction = () => {
	const transactions = useSelector(selectTransactions)	

    return (
        <TransactionContainer>
			<HeaderContainer>Transfer History</HeaderContainer>
			<TransferContainer>	
		{
			transactions.map((transaction, i) => {
				<div>
				<TableContainer>
					<TypeContainer>USD deposit via Bank Transfer</TypeContainer>
					<DateContainer>11-12-2300</DateContainer>
				</TableContainer>
				<AmountContainer>
					<MoneyContainer>50000</MoneyContainer>
				</AmountContainer>
					</div>
			})
		}
			</TransferContainer>	
        </TransactionContainer>
)}


export default Transaction;
